import logo from "../img/logo.png";
import cowalaSoftware from "../img/cowala-software.png";

const Header = () => {
  
  return (
    <header className="header">
      <img src={logo} alt="Logo Cowala" /><div className="container">
        
        <img className="header__logo-texto" src={cowalaSoftware} alt="Cowala Software" />
      </div>
      
    </header>
  );
}

export default Header;
